import React, { useState } from "react";
import Navbar2 from "./Navbar2";
import { Image } from "react-bootstrap";
import './Style/Movielist.css';
import Search from "./Search";
import Pagination from "./Pagination";
import { useNavigate } from "react-router-dom";

function Movielist() {
  const[movie, setMovie] = useState([])
  var navigate = useNavigate();
  function view(id){
    navi
  }
  return (
    <> 
      <Navbar2 />
      <div className="background d-flex justify-content-center align-items-center" style={{ minHeight: '100vh' }}>
      <span className="top"><Search /></span>
        <div className="container">
          <div className="row">
            <div className="col-md-4 mb-4 d-flex justify-content-center">
              <div className="card mx-2 unique-card">
                <Image className="card-img-top" src="https://c8.alamy.com/comp/2JKYCTN/movie-poster-inception-2010-2JKYCTN.jpg" alt="Card image cap" />
                <div className="card-body">
                  <h5 className="card-title">Inception</h5>
                  <p className="card-text">
                    Cobb steals information from his targets by entering their dreams. He is wanted for his alleged role in his wife's murder and his only chance at redemption is to perform a nearly impossible task.
                  </p>
                  <p className="card-text">
                    <small className="text-muted">Last updated 10 sec ago</small>
                  </p>
                  <div className="inline-buttons">
                    <button className="btn btn-primary">View</button>
                    <button className="btn btn-primary">+Watch Later</button>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div>
            <Pagination/>
          </div>
        </div>
      </div>
    </>
  );
}

export default Movielist;
